const APIURL = "https://pokeapi.co/api/v2/pokemon"

/*
function getPokemon(id) {

    fetch(`${APIURL}/${id}`)
        .then((result) => {
            return result.json()
        })
        .then((pokemon) => {
            console.log(pokemon)
        })
}
*/

export function getPokemons() {
    return fetch(`${APIURL}`)
}


export function getPokemons2(id) {
    return fetch(`${APIURL}/${id}`)
}

getPokemon(1)
